import React from "react";
import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/css";
import "swiper/css/pagination";

import { Pagination } from "swiper";

export default function Carousel() {
  return (
    <>
      <Swiper
        slidesPerView={"auto"}
        centeredSlides={true}
        spaceBetween={30}
        pagination={{
          clickable: true,
        }}
        modules={[Pagination]}
        className="mySwiper"
      >
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide1.svg" alt="slide 1"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide2.svg" alt="slide 2"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide3.svg" alt="slide 3"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide4.svg" alt="slide 4"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide5.svg" alt="slide 5"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide6.svg" alt="slide 6"/></SwiperSlide>
        <SwiperSlide> <img className="SF_Slide" src=".././Images/SugarFlower/Carousel/Slide7.svg" alt="slide 7"/></SwiperSlide>
      </Swiper>
    </>
  );
}
